import React from "react";
import Header from "../Header/Header";
import kids from "../Images/kids.png";
import dogs from "../Images/dogs.png";
import cleaning from "../Images/cleaning.png";
import SearchRoundedIcon from '@mui/icons-material/SearchRounded';

export default function HomePage() {
  return (
    <div>
      <Header />
      <div className="bg-[#f2f3f7] flex gap-[350px] justify-center pt-10 pb-0 relative">
        <div>
          <img
            src={kids}
            alt="kids"
            className="w-[226px] h-[150px] rounded-xl mb-12"
          />
          <img
            src={cleaning}
            alt="cleaning"
            className="w-[170px] h-[225px] rounded-xl ml-32"
          />
        </div>
        <div>
          <img
            src={dogs}
            alt="dogs"
            className="w-[638px] h-[524px] rounded-xl rounded-bl-none rounded-br-none"
          />
        </div>
        <div className="bg-white w-[480px] h-[300px] py-10 px-[50px] text-[#001936] left-[583px] top-16 rounded-2xl absolute">
          <h1 className="mb-5 text-4xl font-bold">Our Choices Shape the World We Live In</h1>
          <p className="mb-5 text-xl font-semibold">Find and support a cause that aligns with your passions.</p>
          <div className="flex items-center h-10 border rounded-md border-[#9ba3c0]">
            <input type="search" placeholder="Search by city or cause" className="w-full"/>
            <SearchRoundedIcon className="text-white bg-[#355ffe] h-full w-full"/>
          </div>
        </div>
      </div>
    </div>
  );
}
